const map1 = "";
const map2 = "";

const makeTable = (map) => {
	const len = map.length;
	const tbl = {};
	for (let i = 0; i < len; i += 8) {
		const sjis = parseInt(map.substring(i, i + 4), 16);
		const utf8 = parseInt(map.substring(i + 4, i + 8), 16);
		tbl[sjis] = String.fromCharCode(utf8);
	}
	return tbl;
};
const tbl1 = makeTable(map1);
const tbl2 = makeTable(map2);

const SJIS = {};

SJIS.decode = (sjis, len) => {
	const ss = [];
	let n = 0;
	if (len == null) {
		len = sjis.length;
	} else if (len > sjis.length) {
		len = sjis.length;
	}
	const cerr = String.fromCharCode(65533);
	while (n < len) {
		const m = sjis[n++];
		const c = tbl1[m];
		if (c) {
			ss.push(c);
			continue;
		}
		const m2 = (m << 8) | sjis[n++];
		const c2 = tbl2[m2];
		if (c2) {
			ss.push(c2);
			continue;
		} else {
			ss.push(cerr);
		}
		n--;
	}
	return ss.join("");
};
SJIS.isSJIS = (sjis) => { // 短い時に誤判定がある
	const cerr = String.fromCharCode(65533);
	const s = SJIS.decode(sjis, 10000);
	return s.indexOf(cerr) === -1;
};
SJIS.decodeAuto = (bin) => {
  return SJIS.isSJIS(bin) ? SJIS.decode(bin) : new TextDecoder().decode(bin);
};

export { SJIS };
